    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) AS cor0 WHERE 55 + col2 * col1 * ( - col1 ) / - - 39 * col0 * + col2 NOT IN ( + - col2 * - col2 / + col2 - - col2, + col0, + 69 + + col2 + - col0 );
  - name: tab1

outputs:
  - name: q6014.out
    data: |
      51	14	96
      85	5	59
      91	47	68
